  }

  var timeSplit = timeStr.split(" ");
  var fullDate = timeSplit[0].split("-");
  var appendDate = timeSplit[1].split(":");

  return new Date(fullDate[0], fullDate[1] - 1, fullDate[2], appendDate[0], appendDate[1], appendDate[2]);
}

function p_convertIsoTimeStrToDate( timeStr ) {
  if( !(validateString(timeStr)) ) {
    return null;
  }

  timeStr = timeStr.substr(0, 19);
  var timeSplit = timeStr.split("T");
  var fullDate = timeSplit[0].split("-");
  var appendDate = timeSplit[1].split(":");

  var date = new Date(fullDate[0], fullDate[1] - 1, fullDate[2], appendDate[0], appendDate[1], appendDate[2]);
  date.setHours(date.getHours() + 8);
  return date;
}

function p_convertDateToTimeStamp( date ) {
  return Math.round(date.getTime() / 1000);
}

function p_getLastEventWithoutMW( eventList ) {
  if( eventList instanceof Array && eventList.length > 0 ) {
    for( var i = eventList.length - 1; i >= 0; i-- ) {
