  if( !oom_flag ) {
    var ret = true;
    ret = ret && p_filterBGCrash(report);
    return ret;
  } else {
    var ret = true;
    ret = ret && p_filterOOMBLCrash(report);
    return ret;
  }
}

function p_filterOOMBLCrash( report ) {
  var event_history = report["event"];
  if( event_history instanceof Array && event_history.length > 0 ) {
    for( var i = event_history.length; i >= 0; i-- ) {
      var event_obj = event_history[i];
      if( i == 0 && event_obj instanceof Object && event_obj["e"] === "bl" ) {
        return false;
      }
      if( event_obj instanceof Object && event_obj["e"] !== "mw" ) {
        return true;
      }
    }
  }
  return true;
}

function p_filterBGCrash( report ) {
  var event_history = report["user"]["event_history"];
  if( event_history instanceof Array && event_history.length > 0 ) {
    var eventDic = p_getLastEventWithoutMW(event_history);
    var bgDate = null;
    if( eventDic && eventDic["e"] === "bg"){
      bgDate = p_convertLocalTimeStrToDate(eventDic["t"]);
