        var crashTime = crashReport["timestamp"];
        if( validateString(crashTime) ) {
          var crashDate = p_convertIsoTimeStrToDate(crashTime);
          if( crashDate instanceof Date ) {
            var timeSpace = p_convertDateToTimeStamp(crashDate) - p_convertDateToTimeStamp(bgDate);
            if( timeSpace > JDCrashBGFilterTimerLimit ) {
              return false;
            }
          }
        }
      }
    }
  }
  return true;
}

function p_getCrashType( report ) {
  var crashDic = report["crash"];
  var oom_flag = report["essential_sys"];
  if( oom_flag ) {
